import * as S from './DetailTitle.style';
import YellowTag from '../common/YellowTag';

function DetailTitle() {
  const dummy = ['JAVA', 'Spring'];

  return (
    <S.DetailTitle>
      <S.TitleUpper>
        <S.ProjectTitle>제목이 있는 곳</S.ProjectTitle>
        <S.UserInfo>
          <S.userName>Kimcoding</S.userName>
          <S.userImg></S.userImg>
        </S.UserInfo>
      </S.TitleUpper>
      <S.TitleDowner>
        <S.Tags></S.Tags>
        {dummy.map((tag, idx) => {
          return <YellowTag key={idx}>{tag}</YellowTag>;
        })}
      </S.TitleDowner>
    </S.DetailTitle>
  );
}

export default DetailTitle;
